// JavaScript Document
import React from "react";
import Sidebar from "./sidebar/Sidebar";
import Header from "./header/Header";
import Posts from "./Posts";
import "./home.css";

function Home() {
  const [post, setPost] = useState([]);

  useEffect(() => {
    fetchpost();
  }, [post]);

  return (
    <>
      <Header />
      <div className="home">
        <Posts />
        <Sidebar />
      </div>
    </>
  );
}

export default Home;
